import axios from 'axios'
import { useEffect, useState } from 'react'
import './style.css'

function ListItem() {

    const [pullRequests, setPullRequests] = useState([]);
    useEffect(getPullRequests, [])
    function getPullRequests() {
        axios.get(`http://localhost:3000/webhook`)
            .then(result => {
                setPullRequests(result.data)
                console.log(result.data);
            })
    }
    return (
        <div className="AllPullRequests">
            {pullRequests.map(requst =>
                <div className="pullRequest" key={requst._id} >
                    <label>{requst.action}</label>

                    <label>{requst.number}</label>
                    <label>{requst.changes}</label>
                    <label>{requst.sender.id}</label>
                </div>
            )}
        </div>
    )
}

export default ListItem
